--PREGUNTA 1

--agregar consumidor
CREATE PROCEDURE usp_agrega_consumidor
    @idcons CHAR(5),
    @nomcons VARCHAR(40),
    @apecons VARCHAR(40),
    @emailcons VARCHAR(250),
    @idpais CHAR(3),
    @fonocons VARCHAR(150)
AS
BEGIN
    VALUES (@idcons, @nomcons, @apecons, @emailcons, @idpais, @fonocons);
END;
GO
-- actualizar consumidor
CREATE PROCEDURE usp_actualizar_consumidor
    @idcons CHAR(5),
    @nomcons VARCHAR(40),
    @apecons VARCHAR(40),
    @emailcons VARCHAR(250),
    @idpais CHAR(3),
    @fonocons VARCHAR(150)
AS
BEGIN
    UPDATE tb_Consumidor
    SET
        nomcons = @nomcons,
        apecons = @apecons,
        emailcons = @emailcons,
        idpais = @idpais,
        fonocons = @fonocons
    WHERE idcons = @idcons;
END;
GO

-- elimnar consumidor
CREATE PROCEDURE usp_eliminar_consumidor
    @idcons CHAR(5)
AS
BEGIN
    DELETE FROM tb_Consumidor
    WHERE idcons = @idcons;
END;
GO

-- listar registros de consumidor
CREATE PROCEDURE usp_listar_consumidor
AS
BEGIN
    SELECT
        c.idcons,
        c.nomcons,
        c.apecons,
        c.emailcons,
        c.idpais,
        p.NombrePais AS NombrePais,
        c.fonocons
    FROM
        tb_Consumidor c
    JOIN
        tb_paises p ON c.idpais = p.Idpais;
END;
GO

--listar paises
CREATE PROCEDURE usp_listar_paises
AS
BEGIN
    SELECT Idpais, NombrePais
    FROM tb_paises;
END;
GO

