--- PREGUNTA 2 
CREATE PROCEDURE usp_listar_empleados_pedidos_por_anio
    @Anio INT
AS
BEGIN
    SELECT
        E.IdEmpleado,
        E.ApeEmpleado + ' ' + E.NomEmpleado AS NombreCompletoEmpleado,
        COUNT(PC.IdPedido) AS CantidadPedidos
    FROM
        tb_empleados E
    LEFT JOIN
        tb_pedidoscabe PC ON E.IdEmpleado = PC.IdEmpleado
    WHERE
        YEAR(PC.FechaPedido) = @Anio
    GROUP BY
        E.IdEmpleado, E.ApeEmpleado, E.NomEmpleado
    ORDER BY
        CantidadPedidos DESC, NombreCompletoEmpleado ASC;
END;
GO

